import './App.css';

function App({authorized}) {
  const [emotion, setEmotion] = useState("happy");
  console.log(emotion);
  return (
    <>
    <h1> Hello, hope you are {emotion}. </h1>
    <button onClick={()=> setEmotion(frustrated)}></button>
    </>
  );
}

export default App;
